import React from "react";
import ReactDOM from "react-dom";
import axios from 'axios'

const News = () => {
    
    const fetchnews=()=>{
        axios.get("https://newsapi.org/v2/everything?q=bitcoin&apiKey=888c604dc40544ff992fd30a60cf6998")
        .then((response)=>{
            console.log(response.json());
        })
    }
    return (
        <div>
            <h1>Hii There!!!</h1>
            <button onClick={fetchnews}>Fetch News</button>
        </div>
    )

}
export default News;
